    height: 28px;
    padding: 4px 8px;
    box-sizing: border-box;
    background: #ccc;
    border-radius: 5px;
    margin: 24px auto 0 auto;
    cursor: pointer;

`

const Button = ({
    onClick,
    name
}) => (

      <Wapper/>
)
